import { Link } from "react-router-dom";

const Home = () => {
    return (
        <div>
            <div className="header">
                <Link to={'/'}>Home</Link>
                <Link to={'/login'}>Logout</Link>
            </div>
            <h2>Welcome to the home page</h2>
        </div>
    );
}

export default Home;
